import React from 'react';


const Cabinet = () => {
  return (
    <div>
      <h2>Личный кабинет</h2>
      <p>Добро пожаловать в ваш личный кабинет. Здесь вы можете управлять своими данными и заказами.</p>
      {/* Добавьте функциональность для управления данными пользователя */}
    </div>
  );
};

export default Cabinet;
